import React from 'react';

import categorieImg from '../../assets/categorie.jpg';

import {
  Container,
  Header,
  Title,
  CategoriesList,
  Item,
  ItemImage,
  ItemTitle,
} from './styles';

export default function Categories() {
  return (
    <Container>
      <Header>
        <Title>Categorias</Title>
      </Header>

      <CategoriesList horizontal>
        <Item>
          <ItemImage backgroundColor="pink" src={categorieImg} />
          <ItemTitle>brasileira</ItemTitle>
        </Item>
      </CategoriesList>
    </Container>
  );
}
